import React, { Component } from 'react';
import LoginScreen from '../login/login'
import Dashboard from '../dashboard/dashboard'
import {Route, BrowserRouter, Redirect} from 'react-router-dom'
import Register from '../register/register'
import CameraLayout from '../cameraFeed/cameraLayout'
import NewUserRegistry from '../registerNewUser/registerUser'
import UnrecognizedLayout from '../unrecognizedActivity/unrecognizedDashboard'
import DailyLayout from '../dailyActivity/activityLayout'

class App extends Component {
  render () {
    return (
      <div>
        <BrowserRouter>
            <Redirect exact from='/' to='login'/>
            <Route path="/login" exact component={LoginScreen}/>
            <Route path="/dashboard" exact component={Dashboard}/>
            <Route path="/register" exact component={Register} />
            <Route path="/dashboard/unrecognized" exact component={UnrecognizedLayout} />
            <Route path="/dashboard/daily" exact component={DailyLayout} />
            <Route path="/dashboard/cameras" exact component={CameraLayout} />
            <Route path="/dashboard/registerNewUser" exact component={NewUserRegistry} />
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
